function rowSpan(params) {
    if (params.data.show) {
        return 4;
    } else {
        return 1;
    }
}

function createShowCellRenderer() {
    class ShowCellRenderer {
        init(params) {
            var cellBlank = !params.value;
            if (cellBlank) {
                return null;
            }
            this.ui = document.createElement('div');
            this.ui.innerHTML = '<div class="show-name">' + params.value.name + '' + '</div>' + '<div class="show-presenter">' + params.value.presenter + '</div>';
        }
        getGui() {
            return this.ui;
        }
    }
    return ShowCellRenderer;
}
